import {makeStyles} from '@material-ui/styles';

const centeredStyleObj={
    display:'flex',
    alignItems:'center',
    justifyContent:'center'
}

export default makeStyles({
    container:{
        height:'100vh',
        ...centeredStyleObj
    },
    cardContainer:{
        ...centeredStyleObj,
    }
});
